    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT - ( - 60 ) * - col0 * + col2 BETWEEN - col0 AND - - 64 / + ( - 66 );
  - name: tab2

outputs:
  - name: q762.out
    data: |
      46	51	23
      64	77	40
      75	67	58
